import { Col, Container, Row } from "react-grid-system";
import { ExplanationText, Title } from "../Components/Explanation";
import Link from "../Components/Link";

const Success = () => {
  return (
    <Container>
      <Row>
        <Col>
          <Title>Congratulations! </Title>
          <ExplanationText>
            You have sent a transaction in Solana. Request any feature / have a
            question? Let me know in Github and I will add it to the website!
            Sample questions: How does rent work? How to stake? What are staking
            rewards and how much does 1 solana turn into after a year? How can I
            yield farm with Solana? How do I build my own Serum on Solana?
          </ExplanationText>
        </Col>
      </Row>

      <Link to={`/`}>Go Back To Beginning</Link>
    </Container>
  );
};

export default Success;
